pragma solidity ^0.4.0;

contract StakeAgent {

    uint public balance;

    function StakeAgent(){

    }

    event received(uint amount);

    function () payable public {
//        require(msg.value > 0);
        balance += msg.value;
        deposit(msg.value);
    }

    function deposit(uint amount) internal {
        received(amount);
    }

    function uintToBytes(uint v) constant returns (bytes32 ret) {
        if (v == 0) {
            ret = '0';
        }
        else {
            while (v > 0) {
                ret = bytes32(uint(ret) / (2 ** 8));
                ret |= bytes32(((v % 10) + 48) * 2 ** (8 * 31));
                v /= 10;
            }
        }
        return ret;
    }


}
